/**ABDB**/INSERT INTO `#__eshop_productdetails`  VALUES 
('1', '1', 'Concrete in Railroad Construction', 'concrete', '<p>Published by The Atlas Portland Cement Company in 1909 232 pages, 6”x 9” format, hardcover with dust jacket<br>New foreword by Tony Koester, NMRA Board member and well-known model railroading author and editor<br>Over 120 black-and-white photos and illustrations<br>Original preface written by Sanford E. Thompson, a civil engineer described as one of the leading concrete experts of the time<br>Describes the use of concrete in numerous railroad-related applications, including bridges, piers, retaining walls, stations, tunnels, and many others</p>', '<p>Original preface written by Sanford E. Thompson, a civil engineer described as one of the leading concrete experts of the time.</p>', 'Concrete in Railroad Construction', '', '', '', '45.00', '<p>Concrete in Railroad Construction includes s/h inside the U.S. </p>', '', '', '', '', '', '', '', '', '', '', '', '', 'en-GB'),
