('6', '6', 'Freight Terminals & Trains', 'freight-terminals-trains', '<div class=\"group-left\">\r\n<div class=\"commerce-product-field commerce-product-field-field-product-description field-field-product-description node-3951-product-field-product-description\">\r\n<div class=\"field field-name-field-product-description field-type-text-with-summary field-label-hidden\">\r\n<div class=\"field-items\">\r\n<div class=\"field-item even\">\r\n<p>A comprehensive look at the design and operation of freight terminals in the early 20th century.</p>\r\n<p><em>\"U.S. s/h included to each product, outside U.S. may incur additional shipping fees\"</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"field field-name-field-product field-type-commerce-product-reference field-label-hidden\">\r\n<div class=\"field-items\">\r\n<div class=\"field-item even\"><form id=\"commerce-cart-add-to-cart-form-30\" class=\"commerce-add-to-cart commerce-cart-add-to-cart-form-30\" accept-charset=\"UTF-8\" action=\"https://www.nmra.org/store/products/freight-terminals-trains\" autocomplete=\"off\" method=\"post\">\r\n<div>\r\n<div id=\"edit-line-item-fields\" class=\"form-wrapper\"></div>\r\n</div>\r\n</form></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"group-right\">\r\n<div class=\"commerce-product-field commerce-product-field-field-product-image field-field-product-image node-3951-product-field-product-image\">\r\n<div class=\"field field-name-field-product-image field-type-image field-label-above\">\r\n<div class=\"field-label\"> </div>\r\n<div class=\"field-items\"> </div>\r\n</div>\r\n</div>\r\n</div>', '', 'Freight Terminals & Trains', '', '', '', '$45.00', '<p>Freight Terminals &amp; Trains includes s/h inside the U.S. </p>', '', '', '', '', '', '', '', '', '', '', '', '', 'en-GB'),
