('46', '46', 'Did you forget something?', 'en-GB'),
('47', '47', '<p>We see that you left some product(s) in your cart. Did you have any questions or experience any problems? Feel free to reply to this email and we will get back to you as fast as possible. <a href=\"[CART_LINK]\">View Cart</a></p>', 'en-GB'),
